import styled from 'styled-components'

export const FlexSpaceBeetWeens = styled.div `
display: flex;
width: 100%;
justify-content: space-between;
margin: 15px;
padding: 13px;
`
export const HeaderWrapper = styled.div `
display: flex;
justify-content: space-between;
margin: 15px;
padding: 0px 18px 0px 18px;
background-color: #fff;
border-radius: 13px;
`
